import Feature from "./Feature/Feature";
function Features() {
    return (
        <div className="features">
            <table border="1">
                <tr>
                    <td>ddd</td>
                </tr>
            </table>
            <Feature bgColor="black" title="Change the background" content="We are learning react"/>
            <Feature bgColor="gray" title="Add borders"  content="We are learning react + Javascript"/>
        </div>
    )
}
export default Features;
